import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import { 
  Box,
  Button,
  Heading,
  Paragraph
} from '@digdir/designsystemet-react';

// Pages
import SearchInterface from './components/SearchInterface';
import FaqChatbot from './pages/FaqChatbot';
import ThemeBuilder from './pages/ThemeBuilder';
import ComponentTips from './pages/ComponentTips';
import SlackChannels from './pages/SlackChannels';
import Changelog from './pages/Changelog';

function App() {
  return (
    <Router>
      <div>
        <Box padding="4" background="default">
          <Heading level="1" size="xlarge" spacing>
            Designsystemet Interactive Concepts
          </Heading>
          <Paragraph>Explore interactive features and documentation for the Designsystemet design system.</Paragraph>
        </Box>

        <nav style={{ padding: '1rem', borderBottom: '1px solid #e5e5e5', marginBottom: '2rem' }}>
          <div style={{ display: 'flex', gap: '1rem', justifyContent: 'center' }}>
            <Link to="/"><Button variant="secondary">Search Interface</Button></Link>
            <Link to="/faq-chatbot"><Button variant="secondary">FAQ Chatbot</Button></Link>
            <Link to="/theme-builder"><Button variant="secondary">Theme Builder</Button></Link>
            <Link to="/component-tips"><Button variant="secondary">Component Tips</Button></Link>
            <Link to="/slack-channels"><Button variant="secondary">Slack Channels</Button></Link>
            <Link to="/changelog"><Button variant="secondary">Changelog</Button></Link>
          </div>
        </nav>

        <Box padding="4">
          <Routes>
            <Route path="/" element={<SearchInterface />} />
            <Route path="/faq-chatbot" element={<FaqChatbot />} />
            <Route path="/theme-builder" element={<ThemeBuilder />} />
            <Route path="/component-tips" element={<ComponentTips />} />
            <Route path="/slack-channels" element={<SlackChannels />} />
            <Route path="/changelog" element={<Changelog />} />
          </Routes>
        </Box>

        <footer style={{ padding: '2rem', textAlign: 'center', marginTop: '2rem', borderTop: '1px solid #e5e5e5' }}>
          <Paragraph>Designsystemet Examples - Interactive Concepts</Paragraph>
        </footer>
      </div>
    </Router>
  );
}

export default App;
